// src/components/SignupButton.js
import React from 'react';
import { Link } from 'react-router-dom';

const SignupButton = () => {
  return (
    <Link to="/signup">
      <button className="signup-button">Signup</button>
    </Link>
  );
};

export default SignupButton;
